namespace Practice.Problems;

// https://leetcode.com/problems/max-consecutive-ones?envType=problem-list-v2&envId=aqw21527
public class MaxConsecutiveOnesTests
{
	private static int Calculate(int[] nums)
	{
		var max = 0;
		var current = 0;

		foreach (var num in nums)
		{
			if (num == 1)
			{
				current++;
				max = Math.Max(max, current);
			}
			else
			{
				current = 0;
			}
		}

		return max;
	}

	[Fact]
	public void Test1()
	{
		var nums = new[] { 1, 1, 0, 1, 1, 1 };
		Assert.Equal(3, Calculate(nums));
	}

	[Fact]
	public void Test2()
	{
		var nums = new[] { 1, 0, 1, 1, 0, 1 };
		Assert.Equal(2, Calculate(nums));
	}

